import React from 'react';

import './Login.css';

function Login() {
    return (
        <div className='login'>
            <div className='heading'>login here!</div>
            <form className="login-form">
                <label className='login-form-label'>Email</label>
                <input className='login-form-input' type="text" name="userEmail" placeholder='emusk@twitter.com' />
                <label className='login-form-label'>Password</label>
                <input className='login-form-input' type="password" name="userPassword" placeholder='Something strong...' />
                <button className='login-form-btn'>login</button>
            </form>
        </div>
    )
}

export default Login;
